import Footerr from "../Footer";
import NavBar from "../Navbar";
import { useState, useEffect } from "react";
import Axios  from 'axios';
import Table from 'react-bootstrap/Table'

const Appmnt = () => {
    const [testList, setTestList] = useState([]);

    useEffect(() => {
      Axios.get("http://localhost:5000/appmntt")
      .then((response) => {
          setTestList(response.data)
      })
      
    
    }, [])
    
    return ( 
        <div>
            <NavBar></NavBar>
        
            <div className="text-center fs-3 p-2">Test Appointment</div>
            <div className="container mt-3 p-3 ml-3"> 
            <Table hover>
                <thead>
                    <tr>
                    <th className="text-center">Test ID</th>
                    <th className="text-center">Test Name</th>
                    <th className="text-center">Book the test</th>
                    </tr>
                </thead>
                <tbody>
                    {testList.map((test) => {
                        return (
                    <tr>
                        <td className="text-center">{test.test_id} </td>
                        <td>{test.testName} </td>
                        <td className="text-center"><button className="btn btn-primary btn-sm px-3">Book test</button></td>
                    </tr>  
             )
                    } )} 

                </tbody>
            </Table>            
            </div>






            <Footerr></Footerr>
        </div>
     );
}
 
export default Appmnt;
